from typing import List

class Solution:
    def minReorder(self, n: int, connections: List[List[int]]) -> int:
        planed = [0]
        planedCount = 1
        queue = [0]
        result = 0
        while queue:
            node = queue.pop(0)
            print(queue)
            for i in range(len(connections)):
                connection = connections[i]
                if connection[1] == node and not planed.__contains__(connection[0]):
                    planed.append(connection[0])
                    queue.append(connection[0])
                    planedCount += 1
                elif connection[0] == node and not planed.__contains__(connection[1]):
                    result += 1
                    planed.append(connection[1])
                    queue.append(connection[1])
                    planedCount += 1
                if planedCount == n:
                    return result
        else:
            return result


